      bool ok;
      uint256 r_;
      uint16 nd_;

      {
        uint16 ye = uint16(Math.min(n, findMaxExponent(y)));
        while (ye > 0) {
          (ok, r_) = r.tryMul(y ** ye);
          if (ok) {
            r = r_;
            n -= ye;
            nd_ += ye;
          }
          ye = uint16(Math.min(ye / 2, n));
        }
      }

      while (n > 0) {
        (ok, r_) = r.tryMul(y);
        if (ok) {
          r = r_;
          n--;
          nd_++;
        } else if (nd_ > 0) {
          r /= d;
          nd_--;
        } else {
          r = r.mulDiv(y, d);
          n--;
        }
      }

      uint16 de = findMaxExponent(d);
      while (nd_ > 0) {
        uint16 e = uint16(Math.min(de, nd_));
        r /= d ** e;
        nd_ -= e;
      }
    }
